            caja_compensacion: req.body.caja_compensacion,
            curso_alturas: req.body.curso_alturas,
            rut: req.body.rut,
            estado: req.body.estado,
            nombre_emergencia: req.body.nombre_emergencia,
            celular_emergencia: req.body.celular_emergencia
        })
